import React, { useState, useEffect } from 'react'

function App() {
  const [count, setCount] = useState(0);
  useEffect(() => console.log(count), [count])
  return (
    <div>
      <center>
        <h1>you clicked{count}times</h1>
        <button onClick={() => setCount(count + 1)}>clickme</button>
      </center>
    </div>
  )
}

export default App
